import React from 'react';

const Reviews = ({ reviewsList }) => {
  return (
      <div className="reviews">
          {reviewsList.map(review => (
              <a key={review.id} href={`/review/${review.id}`} className="review-link">
                  {review.summary}
              </a>
          ))}
      </div>
  );
};


export default Reviews;
